**Group specific KPI related to cash**

The Group has defined two main KPI that rely on cash-flow information:

Free Cash-Flow(FCF) =cash-flowsfrom operating activities - CAPEX

with CAPEX corresponding to "Net cash used by investment in operating assets" as presented within Group cash-flows from investing activities.

Cash conversion rate= Free Cash Flow /Group Net Profit

Investing activities

Cash-flows arising from investing activities correspond to expenditures made by the Group for resources intended to generate its future income and cash-flows, such as:

Cash payments to acquire or develop capitalized R&D and tangible assets;

Cash receipts from the sale of tangible assets;

Cash payments to take control (acquisition) / cash receipts from the loss of control (sale) of equity or debt instruments of other entities and interests in joint ventures (see also the Attention point below on the [acquisition / sale of](https://schneiderelectric.sharepoint.com/sites/GroupAccountingPolicyManual/Policies/Cash and cash equivalents.aspxDefinitions) shares);

Cash advances and loans made / cash receipts from the repayment of advances and loans made to other parties;

Cash payments for / cash receipts from futures contracts, forward contracts, option contracts and swap contracts, except when the contracts are held for dealing or trading purposes, or the payments / receipts are classified as financing activities(see the

[Financial assets and liabilities](https://schneiderelectric.sharepoint.com/sites/GroupAccountingPolicyManual/Policies/Financial instruments.aspx) policy for further details).

**Scope**

The accounting guidance presented herein should be applied to all intangible assets, except for intangible assets that are within the scope of another standard:

Intangible assets held for sale in the ordinary course of business (see the [Inventories](https://schneiderelectric.sharepoint.com/sites/GroupAccountingPolicyManual/Policies/Inventory.aspx) policy);

Deferred tax assets (see the [Income taxes](https://schneiderelectric.sharepoint.com/sites/GroupAccountingPolicyManual/Policies/Income Taxes.aspx) policy);

Leases (see the [Leases](https://schneiderelectric.sharepoint.com/sites/GroupAccountingPolicyManual/Policies/Leases.aspx) policy);

Assets arising from employee benefits (see the [Employee Benefits](https://schneiderelectric.sharepoint.com/sites/GroupAccountingPolicyManual/Policies/Employee Benefits.aspx) policy);

Financial assets (see the [Financial assets and liabilities](https://schneiderelectric.sharepoint.com/sites/GroupAccountingPolicyManual/Policies/Financial instruments.aspx) policy);

Goodwill acquired in a business combination (see the [Transaction Accounting  Acquisitions](https://schneiderelectric.sharepoint.com/sites/GroupAccountingPolicyManual/Policies/Transaction accounting - Business combination.aspx) policy);

Insurance contracts;

Non-current intangible assets classified as held for sale (see theTransaction [Accounting  Divestments](https://schneiderelectric.sharepoint.com/sites/GroupAccountingPolicyManual/Policies/Transaction accounting - Disposals.aspx) policy);

Assets arising from contracts with customers (see theRevenue [recognition  General principles](https://schneiderelectric.sharepoint.com/sites/GroupAccountingPolicyManual/Policies/Revenue from contracts with customers vFinale0809.aspx1.2. Group accounting policies-1.2.3. General Principles) policy).

Group intangible assets in the scope of this policy usually pertain to trademarks, capitalized development projects, technologies / patents, customer relationships and software.
